def distancePoints(L1, L2):
    """Computes the distance between the two sets of coordinates
       input: 2 tuples with the corresponding coordinates
       output: distance"""

    # print(x1, x2)

    x = L1[0] - L2[0]
    y = L1[1] - L2[1]
    z = L1[2] - L2[2]
    return math.sqrt(x * x + y * y + z * z)


def getCentroid(d_res):
    """Purpose: Calculates the center of mass of a residue
       Input: a dico residue
       Output: coords x, y, z of the centroid (tuple format)
    """

    x = y = z = 0.0

    # loop over all atoms
    for atom in d_res["atomlist"]:
        x += d_res[atom]["x"] #somme les cordonn√©es en x               
        y += d_res[atom]["y"]
        z += d_res[atom]["z"]

    Xcen = float(x) / len(d_res["atomlist"])
    Ycen = float(y) / len(d_res["atomlist"])
    Zcen = float(z) / len(d_res["atomlist"])

    return (Xcen, Ycen, Zcen)


def compDistance(d_res1, d_res2, mode="atom"):
    """Purpose: computes the distance between 2 residues (res1 and res2)
                Distance can be calculated either as the min distance between all the pairwise distances (atom-atom)
                or between the 2 centroids of the residues

       Inputs:  d_res1, d_res2 which are dico corresponding to res 1 and res 2 respectively
                mode: either "atom" or "centroid" (string)

       Output:  distance (float) """

    # mode atom: min distance atom-atom
    # --------------------------------------
    if mode == "atom":

        # *** computes all pairwise distances between atoms of res1, res2
        distances = []
        # loop over all atoms of res1
        for atom1 in d_res1["atomlist"]:
            coord1 = [d_res1[atom1]["x"], d_res1[atom1]["y"], d_res1[atom1]["z"]]
            # loop over all atoms of res2
            for atom2 in d_res2["atomlist"]:
                coord2 = [d_res2[atom2]["x"], d_res2[atom2]["y"], d_res2[atom2]["z"]]
                distances.append(distancePoints((coord1[0], coord1[1], coord1[2]), (coord2[0], coord2[1], coord2[2])))
        d_res1_res2 = min(distances)

    # mode centroid: distance between the centroids of the 2 given residues
    # ----------------------------------------------------------------------
    elif mode == "centroid":
        cent1 = getCentroid(d_res1)
        cent2 = getCentroid(d_res2)
        # print(cent1, cent2)

        d_res1_res2 = distancePoints(cent1, cent2)

    return d_res1_res2



def computeContactMatrix(d_coords, chain, mode) :

    nbres = len(d_coords[chain]["reslist"])
    distmat = np.zeros((nbres,nbres))
    
    for i in range(nbres) :
        j = i + 1
        d_coordi = d_coords[chain][d_coords[chain]["reslist"][i]]
        while j < nbres :
            d_coordj = d_coords[chain][d_coords[chain]["reslist"][j]]
            dij = compDistance(d_coordi, d_coordj, mode)
            distmat[i,j], distmat[j,i] = dij, dij
            j +=1

    return distmat    



def extractContactResidues(matdist, seuil) :

    contacts = []
    for i in range(len(matdist[0])) :
        for j in range (i+1, len(matdist[0])) :
            if matdist[i][j] <= seuil :
                contacts.append([i, j])

    return contacts



def resid(contactsList, dPDB, chain ) :

    resPairs = []
    
    for pair in contactsList :
        resPairs.append([dPDB[chain]["reslist"][pair[0]], dPDB[chain]["reslist"][pair[1]]])        

    return resPairs



def get_contact(liste_dix) : 
    
    liste_residu = []
    liste_contact = []
    entier = 0
    for i in range(len(liste_dix)) : 
        for j in range(len(liste_dix[i])) :
            file_pdb = "/home/ctoussaint/pdb_file/pdb"  + liste_dix[i][j] + ".ent"
            #print(file_pdb)

            if os.path.exists(file_pdb) : 
                dico = PDB_parser(file_pdb)

                for chain in dico['chains'] : 
                    matdist = computeContactMatrix(dico, chain, "atom" )
                    contacts = extractContactResidues(matdist, 5)
                    liste_contact.append((liste_dix[i][j], chain, contacts))
                    residu = resid(contacts, dico, chain)
                    liste_residu.append((liste_dix[i][j], chain, residu))
                    
                path_folder_Result = "/home/ctoussaint/pdb_pfam"
                name = "contact_"+ liste_dix[i][j] + "_"+ str(entier) 
                cont = np.array(liste_contact, dtype=object)
                path_contact = f"{path_folder_Result}/{name}"
                np.save(path_contact, cont)

                name2 = "residu" + liste_dix[i][j] + "_" + str(entier)
                residus = np.array(liste_residu, dtype=object)
                path_residu = f"{path_folder_Result}/{name2}"
                np.save(path_residu, residus)

                entier +=1

    path_folder_Result = "/home/ctoussaint/pdb_pfam"
    path_contact = f"{path_folder_Result}/contact"
    np.save(path_contact, liste_contact)

    path_residu = f"{path_folder_Result}/residu_contact"
    np.save(path_residu, liste_residu)


    return liste_contact, liste_residu



